import React from "react";
import {Nav, NavDropdown} from "react-bootstrap";


const NavBar = (props) => {
    return (
        <div>
            <NavDropdown title={props.title} id="collasible-nav-dropdown">
                <NavDropdown.Item href={props.id}>{props.name}</NavDropdown.Item>
                <NavDropdown.Divider/>
                <NavDropdown.Item href="/diocese">{props.all}</NavDropdown.Item>
            </NavDropdown>
        </div>
    )
}
export default NavBar;
